import Carousel from 'react-native-snap-carousel';
import React, { Component } from 'react';
import { 
  View,
  Text,
  Image,
  TouchableOpacity
} from 'react-native';

import {createStackNavigator} from 'react-navigation';

 
class Main extends Component {

    constructor(props){
      super(props);
      this.state  = {
        entries : [
          {title : 'Trường ĐHSPKT TP Hồ Chí Minh',Image : 'data:image/jpeg;base64,'},
          {title : 'BigC Bình Dương', Image:'data:image/jpeg;base64,'},
          {title : 'Lotte Thủ Đức',Image:'data:image/jpeg;base64,'},
          {title : 'Đại học Ngoại thương',Image:'data:image/jpeg;base64,'},
          
        ]
      }
    }

    _renderItem ({item,index}) {
        
        return (
            <View style={{width:200,height:200,backgroundColor:'blue',margin:10}}>
                <Image
                    style={{width:200,height:120}}
                    source={{uri:item.Image}}
                />
                <TouchableOpacity onPress={()=>{this.props.navigation.push('Home1')}}>
                    <Text style={{fontSize:12,fontWeight:'bold',color:'#fff',justifyContent:"center",margin:10}}>{item.title}</Text>
                </TouchableOpacity>
            </View>
        );
    }
 
    render () {
        var a = ({item,index})=>{
            return (
                <View style={{width:200,height:200,backgroundColor:'blue',margin:10}}>
                    <Image
                        style={{width:200,height:120}}
                        source={{uri:item.Image}}
                    />
                    <TouchableOpacity onPress={()=>{this.props.navigation.navigate('Home1',{name : item.title})}}>
                        <Text style={{fontSize:12,fontWeight:'bold',color:'#fff',justifyContent:"center",margin:10}}>{item.title}</Text>
                    </TouchableOpacity>
                </View>
            );
        }
        return (
            <View style={{flex:1, backgroundColor:'lightblue',justifyContent:'center',alignItems:'center'}}>
                <TouchableOpacity onPress={()=>{this.props.navigation.navigate('Home1')}}>
                    <View style={{width:200,height:200}}>
                        <Text>Go to Chi tiet</Text>
                    </View>
                </TouchableOpacity>
                <Carousel style={{width:100,height:100}}
                ref={(c) => { this._carousel = c; }}
                data={this.state.entries}
                renderItem={a}
                itemWidth={200}
                sliderWidth={300}
                enableMomentum={true}
                activeAnimationType={'spring'}
                activeAnimationOptions={{
                        friction: 40,
                        tension: 40
                    }}
                />
            </View>
        );
    }
}

import Chitet from './src/components/chitet';

export default App = createStackNavigator({
    Home : {
        screen : Main,
        navigationOptions : {
            header : null
        }
    },
    Home1 : {
        screen : Chitet
    }
})